import React, { Component } from "react";
import "./index.css";

export class Home extends Component {
  constructor(props) {
    super(props);
    this.State = {
      movie: "",
    };
  }
  render() {
    return (
      <div className="container">
        <form action="submit">
          <input type="search" placeholder="Insert movie" />
        </form>
      </div>
    );
  }
}

export default Home;
